import Vue from 'vue'
import App from './App.vue'
import VueResource from 'vue-resource' //for http request
import router from "./routes";

Vue.config.productionTip = false
Vue.use(VueResource).use(router)


new Vue({
    render: h => h(App),
}).$mount('#app').use(VueResource);
